create table m_rgn
(
    rgn_id varchar not null
        constraint m_rgn_pk
            primary key,
    rgn_nm varchar,
    srt_od integer
);

comment on table m_rgn is '지역';

alter table m_rgn
    owner to postgres;

create unique index m_rgn_rgn_id_uindex
    on m_rgn (rgn_id);


create table m_cus
(
    cus_id  varchar not null
        constraint m_cus_pk
            primary key,
    cus_nm  varchar,
    mbl_no  varchar,
    eml_ad  varchar,
    pwd     varchar,
    rgn_id  varchar
        constraint m_cus_m_rgn_rgn_id_fk
            references m_rgn,
    adr_txt varchar,
    gnd_tp  varchar,
    bth_ymd varchar,
    cus_gd  varchar
);

comment on table m_cus is '고객 마스터 테이블';

comment on column m_cus.cus_id is '고객ID';

comment on column m_cus.cus_nm is '고객명';

comment on column m_cus.mbl_no is '전화번호';

comment on column m_cus.eml_ad is 'Email';

comment on column m_cus.pwd is '패스워드';

comment on column m_cus.rgn_id is '지역ID(FK)';

comment on column m_cus.adr_txt is '주소';

comment on column m_cus.gnd_tp is '성별구분';

comment on column m_cus.bth_ymd is '생년월일';

comment on column m_cus.cus_gd is '고객등급';

alter table m_cus
    owner to postgres;

create unique index m_cus_cus_id_uindex
    on m_cus (cus_id);


create table m_itm
(
    itm_id  varchar not null
        constraint m_itm_1_pk
            primary key,
    itm_nm  varchar,
    itm_tp  varchar,
    unt_prc integer
);

alter table m_itm
    owner to postgres;

create unique index m_itm_1_itm_id_uindex
    on m_itm (itm_id);


create table t_itm_evl
(
    itm_id     varchar not null
        constraint t_itm_evl_m_itm_itm_id_fk
            references m_itm,
    evl_lst_no integer not null,
    cus_id     varchar not null
        constraint t_itm_evl_m_cus_cus_id_fk
            references m_cus,
    evl_dsc    varchar(1000),
    evl_dt     timestamp,
    evl_pt     numeric(18, 2),
    constraint t_itm_evl_pk
        primary key (itm_id, evl_lst_no)
);

comment on table t_itm_evl is '아이템 평가
고객이 아이템에 평가를 수행한 기록';

comment on column t_itm_evl.itm_id is '아이템ID';

comment on column t_itm_evl.evl_lst_no is '평가순번
';

comment on column t_itm_evl.cus_id is '고객ID(FK)';

comment on column t_itm_evl.evl_dsc is '평가내용';

comment on column t_itm_evl.evl_dt is '평가일시';

comment on column t_itm_evl.evl_pt is '평가점수';

alter table t_itm_evl
    owner to postgres;

create unique index t_itm_evl_itm_id_evl_lst_no_uindex
    on t_itm_evl (itm_id, evl_lst_no);


create table m_itm_prc_his
(
    itm_id  varchar not null
        constraint m_itm_prc_his_m_itm_itm_id_fk
