    to_ymd  varchar not null,
    fr_ymd  varchar,
    unt_prc integer,
    constraint m_itm_prc_his_pk
        primary key (itm_id, to_ymd)
);

alter table m_itm_prc_his
    owner to postgres;

create unique index m_itm_prc_his_itm_id_to_ymd_uindex
    on m_itm_prc_his (itm_id, to_ymd);


create table t_ord
(
    ord_seq integer not null
        constraint t_ord_pk
            primary key,
    cus_id  varchar not null
        constraint t_ord_m_cus_cus_id_fk
            references m_cus,
    ord_dt  timestamp,
    ord_st  varchar,
    pay_dt  timestamp,
    pay_tp  varchar,
    ord_amt numeric(18, 3),
    pay_amt numeric(18, 3)
);

alter table t_ord
    owner to postgres;

create unique index t_ord_ord_seq_uindex
    on t_ord (ord_seq);


create table t_ord_det
(
    ord_seq    integer not null
        constraint t_ord_det_t_ord_ord_seq_fk
            references t_ord,
    ord_det_no integer not null,
    itm_id     varchar not null
        constraint t_ord_det_m_itm_itm_id_fk
            references m_itm,
    ord_qty    integer,
    unt_prc    numeric(18, 3),
    constraint t_ord_det_pk
        primary key (ord_seq, ord_det_no)
);

comment on table t_ord_det is '주문상세';

comment on column t_ord_det.ord_seq is '주문시퀀스';

comment on column t_ord_det.ord_det_no is '주문상세순번';

comment on column t_ord_det.itm_id is '아이템ID(FK)';

comment on column t_ord_det.ord_qty is '주문수량';

comment on column t_ord_det.unt_prc is '판매단가';

alter table t_ord_det
    owner to postgres;

create unique index t_ord_det_ord_seq_ord_det_no_uindex
    on t_ord_det (ord_seq, ord_det_no);

